import { StyleSheet } from 'react-native';

export const styles = StyleSheet.create({
    cube: {
        backgroundColor: "red",
        width: 48,
        height: 48,
        borderRadius: 16,
        borderWidth: 1,

        // Shadow
        shadowColor: "#000",
        shadowOffset: {
            width: 0,
            height: 3,
        },
        shadowOpacity: 0.1,
        shadowRadius: 4.65,
        elevation: 7,
    }
});
